import React, { useEffect, useState } from "react";

const DashBoardStocktaking = ({ stocktake }) => {
    
    return (
        <div>
        <h6>Stocktaking</h6>
        {stocktake ? <p>Stocktake in Progress</p> : <p>No Stocktake in Progress</p>}
        </div>
    )
}

export default DashBoardStocktaking;
